import React from "react";

export default function LeaderboardWidget() {
  // Placeholder: Replace with real leaderboard data
  return (
    <div className="widget leaderboard">
      <h3>Top Traders This Week</h3>
      <ol>
        <li>TraderA (PnL Ratio: 3.2)</li>
        <li>TraderB (PnL Ratio: 2.9)</li>
        <li>TraderC (PnL Ratio: 2.7)</li>
      </ol>
    </div>
  );
}
